import React from "react";
import "./List.css";

function List({ data }) {
  return (
    <div className="list__container">
      <ul className="list__items">
        {data.map((d) => (
          <li className="list__item">{d.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default List;

